#20. Valid Parentheses

class Solution:
    
    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """
        dic = {'(':')', '[':']', '{':'}'}
        news = ''
        for i in range(len(s)):
            if s[i] in dic:
                news = news + s[i]
            elif news == '' or news[-1] not in dic or s[i] != dic[news[-1]]:
                return False
            else: 
                news = news[:-1]
                
        if news == '': return True
        else: return False

